// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/proxy/utils/Initializable.sol";


contract Evoting is Initializable{

    string private _description;
    address private _administrator1;
    address private _administrator2;
    address private _administrator3;
    address private _administrator4;
    address private _administrator5;

    mapping(address => bytes32) private values;

    event ParametersCommitted(address admin, bool success);
    event ParametersChanged(address admin, bool success);
    event InitContract(address admin1, address admin2, address admin3, address admin4, address admin5);

    modifier onlyAdministrator(address caller) {
        require(caller == _administrator1 || caller == _administrator2 || 
        caller == _administrator3 || caller == _administrator4 || 
        caller == _administrator5, "You're not an administrator !");
        _;
    }


    function init(string calldata _desc, address _admin1, address _admin2, address _admin3, address _admin4, address _admin5) initializer external{
        _description = _desc;
        _administrator1 = _admin1;
        _administrator2 = _admin2;
        _administrator3 = _admin3;
        _administrator4 = _admin4;
        _administrator5 = _admin5;
        emit InitContract(_administrator1, _administrator2, _administrator3, _administrator4, _administrator5);
    } 

    function committParameters(uint256 _gg, uint256 _pp, uint256 _vk) external onlyAdministrator(msg.sender){
        require(values[msg.sender] == bytes32(0), "You have already committed a value");
        values[msg.sender] = keccak256(abi.encodePacked(_gg, _pp, _vk));
        emit ParametersCommitted(msg.sender, true);
    }

    function changeParameters(uint256 _gg, uint256 _pp, uint256 _vk) external onlyAdministrator(msg.sender) { 
        require(values[msg.sender] != bytes32(0), "You need to first committ a value");
        values[msg.sender] = keccak256(abi.encodePacked(_gg, _pp, _vk));
        emit ParametersChanged(msg.sender, true);
    }

    function getHashedParameters(address _admin) external view returns(bytes32 value){
        value = values[_admin];
    }

    function getDescription() external view returns(string memory description){
        description = _description;
    }


}
